export default function returnSearch(string, listToRender, profileData) {
  let temp = {}

  const removeValue = (list) => {
    //Removes first and last item in the list.
    return list.slice(1)
  }

  listToRender.forEach((listItem) => {
    let returnedList = []
    let currentList = []

    profileData[listItem.toLowerCase()]?.forEach(value => {
      value.slice(1, Object.keys(value).at(-1)).forEach((item, i) => console.log(item, i))
        if (item.data.toLowerCase().includes(string.target.value.toLowerCase())) {
          if (!currentList.includes(value[0]['key'])) {
            currentList.push(value[0]['key'])
            returnedList.push(value)
          }
        }
      // })
    })
    temp[listItem.toLowerCase()] = returnedList
  })

  return temp
}
